import { useParams } from "react-router-dom";
import axios from "axios";
import { useEffect, useReducer } from "react";

function ProductScreen() {
  const params = useParams();
  const { slug } = params;
  return (
    <div>
      <h1>{slug}</h1>
    </div>
  );
}
export default ProductScreen;
